import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

import Header from './component/Header'
import PatronForm from './component/PatronForm'
import Result from './component/Result'


function App() {
  return(
    <div>
      <Header />
      <PatronForm />
    </div>
  )
}


ReactDOM.render(
  <App />,
  document.getElementById('root')
);
